import Image from 'next/image';
import React from 'react';

interface Props {
  width: number;
  height: number;
}

/**
 * @returns hardcoded svg value for the app icon
 */
export const TreelofIcon: React.FC<Props> = (props) => {
  return (
    <Image
      alt="icon"
      width={props.width}
      height={props.height}
      src="data:image/png;base64,"
    />
  );
};
